import React from 'react';

import {Button,ListGroup,Form,Col} from 'react-bootstrap';

function authority(){
    return(
        <div>
    
        <Form.Group as={Col} controlId="formGridState">
        <Form.Label>State</Form.Label>
        <Form.Control as="select">
          <option>Choose</option>
          <option>add</option>
          <option>remove</option>
        </Form.Control>
      </Form.Group>
        <ListGroup>
            <ListGroup.Item>Add</ListGroup.Item>
            <ListGroup.Item>Modify</ListGroup.Item>
            <ListGroup.Item>Delete</ListGroup.Item>
            <ListGroup.Item>View</ListGroup.Item>
            <ListGroup.Item>Clear</ListGroup.Item>
         </ListGroup>

        <div classs="text-center">
    
            <Button variant="info" type=" save ">save</Button>{' '}

            <Button variant="danger" type=" save ">Delete</Button>{' '}
        
        </div>

        <div class="text-center">
      
            <Button variant="primary" type=" save ">Remove Modify Right</Button>{' '}

            <Button variant="secondary" type=" save ">View All</Button>{' '}
        </div>
        
        <Form.Check inline label="Add Right" />  
        <Form.Check inline label="Modify Right" /> 
        <Form.Check inline label="Delete Right" />
        <Form.Check inline label="View Right" />     
  
       
    
        </div>
   
    );
}
export default authority;
